import React, { useEffect, useState } from "react";
import './Table.css';


function App(){

    const [data,setData]=useState(null)


    useEffect(()=>{
fetch("http://localhost:3006/StudenInfo")
.then((res)=>{
   return res.json()
})
.then((resp)=>{
    setData(resp)
})

},[])


    return(
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>RollNo</th>
                        <th>Name</th>
                        <th>City</th>
                        <th>Dept</th>
                    </tr>
                </thead>
                <tbody>
                {data && data.map((item)=>(
                    <tr>
                      
                        <td>{item.id}</td>
                        <td>{item.rollNo}</td>
                        <td>{item.name}</td>
                        <td>{item.city}</td>
                        <td>{item.dept}</td>
                       
                    </tr>
                     ))}
                </tbody>
            </table>
        </div>
    )
}

export default App;
